mapper.select:

select 

from ONL_ONLINE_LOG

  
    and ONLINE_ID = #{onlineId,jdbcType=BIGINT}
  
  
    and SUBJECT_TYPE = #{subjectType,jdbcType=TINYINT}
  
  
    and ONLINE_TITLE = #{onlineTitle,jdbcType=VARCHAR}
  
  
    and ONLINE_DETAIL = #{onlineDetail,jdbcType=VARCHAR}
  
  
    and ONLINE_ORG_ID = #{onlineOrgId,jdbcType=BIGINT}
  
  
    and SUPPLIER_ID = #{supplierId,jdbcType=BIGINT}
  
  
    and DELIVER_ORG_ID = #{deliverOrgId,jdbcType=BIGINT}
  
  
    and OP_ID = #{opId,jdbcType=BIGINT}
  
  
    and OP_TIME = #{opTime,jdbcType=TIMESTAMP}
  
  
    and PRODUCT_ID = #{productId,jdbcType=BIGINT}
  
  
    and IS_BELOW = #{isBelow,jdbcType=TINYINT}
  
  
    and IS_ONLINE_PLATFORM = #{isOnlinePlatform,jdbcType=TINYINT}
  
  
    and IS_ONLINE = #{isOnline,jdbcType=TINYINT}


select count(*) 
from ONL_ONLINE_LOG
where ID = #{id,jdbcType=BIGINT}


